interface AATTokenInterface{
    function setASTTokenBalance(address _astToken, uint256 _amount) external;
    function transferASTTokens(address _astToken, address _account, uint256 _astAmount) external ;
}

contract AST is ERC20 {
    address public assetWallet;
    uint256 private totalSupply_;
    address public factory;

    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _totalSupply,
        address _assetLockedwallet,
        address _factory,
        address _AATToken,
        uint8 lockedPercentage,
        uint8 aatPercentage
    ) ERC20(_name, _symbol) {
        totalSupply_ = _totalSupply * 10 ** decimals();
        uint256 lockedSupply = (totalSupply_ * lockedPercentage)/ 100;
        uint256 aatSupply = (totalSupply_ * aatPercentage)/ 100;
        _mint(_assetLockedwallet, lockedSupply);
        _mint(_AATToken, aatSupply);
        assetWallet = _assetLockedwallet;
        factory = _factory;
    }

    function burn(address account, uint256 amount) external returns (bool) {
        require(factory == msg.sender, "You Cannot Burn");
        _burn(account, amount);
        return true;
    }
}

contract ASTTokenFactory is Ownable {
    address[] private astTokens;
    mapping(address => uint256) public aatConversion;
    address public poolWallet;
    address public assetLockedWallet;
    uint256 public tokenCount;
    address public aatToken;


 constructor(address _poolWallet, address _assetLockedWallet) Ownable(msg.sender){
  require(_poolWallet != (address(0)) && _assetLockedWallet != (address(0)), "Invalid address");
  poolWallet = _poolWallet;
  assetLockedWallet = _assetLockedWallet;
 }

    /*
     * totalSupply_ = The total amount user wants to mint for AST token.
     * _ratio = Propotion of AST to AAT and AAt to AST token conversion.
     * Only Called By contract Owner.
     * If owner wants to set 1AAT = 7.533AST token then he needs to provide 7533 as ratio.
     * If owner wants to set 1AAT = 75.333AST token then he needs to provide 75333 as ratio.
     * Multiplying by 1000 to get value upto the 3 decimals 
     */

    function createASTToken(
        string memory name_,
        string memory symbol_,
        uint256 totalSupply_,
        uint256 _ratio,
        uint8 lockedPercentage,
        uint8 aatPercentage
    ) external onlyOwner returns (AST) {
        require(_ratio > 0, "Invalid Amount");
        require(aatToken != address(0), "AAT Token Not Set");
        require(poolWallet != address(0), "Invalid Pool Wallet");
        require(
            assetLockedWallet != address(0),
            "Asset Locked Wallet Is Not Set"
        );
 
        AST token = new AST(
            name_,
            symbol_,
            totalSupply_,
            assetLockedWallet,
            address(this),
            aatToken,
            lockedPercentage,
            aatPercentage
        );
        astTokens.push(address(token));
        tokenCount++;
        aatConversion[address(token)] = _ratio;
        uint256 mintAATAmount = (totalSupply_ * 1000)  / _ratio ;
        IAAT(aatToken).mint(poolWallet, mintAATAmount * 10 ** IAAT(aatToken).decimals());
        uint256 lockedAST = ((totalSupply_ * aatPercentage) / 100) * 10 ** IAAT(address(token)).decimals();
        AATTokenInterface(aatToken).setASTTokenBalance(address(token), lockedAST);
        return token;
    }

    /*
     * _astToken = AST token contract address
     * _aatAmount=AAT token amount u want to burn
     * it will return AST token amount in proportion to AAT token Amount.
     * it also returns The max AST token u can Burn.
     * Dividing by 1000 to get value upto the 3 decimals 
     */

    function astConversionAmount(address _astToken, uint256 _aatAmount)
        public
        view
        returns (uint256 astAmount_, uint256 needToBurn)
    {
        require(_astToken != address(0), "Invalid Address");
        require(_aatAmount > 0, "Invalid Amount");

        uint256 convRatio = aatConversion[_astToken];
        needToBurn =
            IERC20(_astToken).totalSupply() -
            IERC20(_astToken).balanceOf(assetLockedWallet);
        astAmount_ = (_aatAmount * convRatio) / 1000;
        return (astAmount_, needToBurn);
    }

    /*
     * _astToken=AST token contract address
     * This will return AAT token amount for Burning to return back the ast locked tokens to asset locked wallet.
     */

    function aatBurnAmount(address _astToken)
        external
        view
        returns (uint256 aatAmount_)
    {
        require(_astToken != address(0), "Invalid Address");

        return
            aatAmount_ =
                ((IERC20(_astToken).totalSupply() -
                    IERC20(_astToken).balanceOf(assetLockedWallet)) * 1000 ) /
                aatConversion[_astToken];
    }

    /*
     * _astToken=AST token contract address
     * _astAmount=AST token Amount
     * It will called internally when some User burns AAT token.
     */

    function returnAstToLockedWallet(address _astToken, uint256 _astAmount)
        internal
    {
        require(_astToken != address(0), "Invalid Address");
        require(_astAmount > 0, "Invalid Amount");

        AATTokenInterface(aatToken).transferASTTokens(_astToken, assetLockedWallet, _astAmount);
    }

    /*
     * _astToken=AST token contract address
     * _user=wallet address of any user
     * thic can be called to check the given users AST Token Balance.
     */

    function  astTokenBalance(address _astToken, address _user)
        external 
        view
        returns (uint256, uint256)
    {
        return (
            IERC20(_astToken).totalSupply(),
            IERC20(_astToken).balanceOf(_user)
        );
    }

    /*
     * Users who have the AAT token can call this fucntion and burn their AAT token.
     * _amount = AAT token Amount user wants to burn.
     * _astToken = AST token adress to which you want to convert your AAT when its Burned.
     */

    function burnAAT(uint256 _amount, address _astToken)
        external
    {
        require(aatToken != address(0), "AAT Token Not Set");

        (uint256 burnamt, uint256 needToBurn) = astConversionAmount(
            _astToken,
            _amount
        );
        require(burnamt <= needToBurn, "Exceeding Limits");

        IAAT(aatToken).burn(msg.sender, _amount);
        returnAstToLockedWallet(_astToken, burnamt);
    }

    /*
     * _astToken=AST token Address you want to burn.
     * Only Called By owner
     * This will execute when AssetOwner wallet got above 99% of Ast token of which Owner wants to burn.
     */

    function burnAstToken(address _astToken) external onlyOwner {
        require(_astToken != address(0), "Invalid Address");
        require(
            (IERC20(_astToken).balanceOf(assetLockedWallet) * 100) /
                IERC20(_astToken).totalSupply() >=
                99,
            "Burning amount less than 99% of the supply"
        );

        IAST(_astToken).burn(
            assetLockedWallet,
            IERC20(_astToken).balanceOf(assetLockedWallet)
        );
    }

    function getASTs() external view returns (address[] memory){
        return astTokens;
    }
     /*
     * _token = AAT contract address
     * this will set the AAT Contract address to Factory Contract.
     */

    function setAATToken(address _token) external onlyOwner {
        require(_token != address(0), "Invalid Address");
        aatToken = _token;
    }

    /*
     * _wallet = User wallet to whom the AAT token will be transfered while Creating AST token.
     */

    function setPoolWallet(address _wallet) external onlyOwner {
        require(_wallet != address(0), "Invalid Address");

        poolWallet = _wallet;
    }

    /*
     *_wallet = User wallet to whom the the 50% ASt token will be minted while creating AST token.
     */

    function setAssetLockedWallet(address _wallet) external onlyOwner {
        require(_wallet != address(0), "Invalid Address");
        assetLockedWallet = _wallet;
    }
}

